import React from "react";
import FoodCard from "../../components/FoodCard/FoodCard";
import pizzaImage from "../../assets/pizza.jpg";
import tacosImage from "../../assets/tacos.jpg";
import burgerImage from "../../assets/burger.jpg";

const Menu = (props) => {
	const menu = [
		{
			image: pizzaImage,
			title: "Pizza Vegetale 🍕",
			tags: ["#vegetarian", "#italian"],
			desc:
				"Yummy veggie pizza with tasty olives, crisp peppers, fresh arugula and original italian tomato sauce.",
			calories: "🏃🏻‍♂️ 850 calories",
			time: "⏲ 15 min",
			rating: "⭐️ 4.2 / 5",
			price: "$9.99",
		},
		{
			image: tacosImage,
			title: "Deconstructed Tacos 🧀",
			tags: ["#cheese", "#mexican"],
			desc:
				"Delicious chips with a blend of cheeses, guacamole, fresh tomatoes and special house made sauce.",
			calories: "🏃🏻‍♂️ 750 calories",
			time: "⏲ 7 min",
			rating: "⭐️ 4.8 / 5",
			price: "$7.99",
		},
		{
			image: burgerImage,
			title: "Deluxe Burger 🍔",
			tags: ["#protein", "#american"],
			desc:
				"Yummy veggie pizza with tasty olives, crisp peppers, fresh arugula and original italian tomato sauce.",
			calories: "🏃🏻‍♂️ 900 calories",
			time: "⏲ 10 min",
			rating: "⭐️ 4.6 / 5",
			price: "$11.99",
		},
	];

	return (
		<div>
			<FoodCard />
		</div>
	);
};

export default Menu;
